              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '</span>\tOption 1: While the passage discusses Facebook\'s proprietary data and its role in measuring social capital, this is not the main idea of the passage.\r<br /><span style="font-family: ;color: #000000;">Option 2: The statement is only a part of the argument made in the passage.</span>\r<br /><span style="font-family: ;color: #000000;">Option 3.Correct.The passage discusses the concept of social capital and its decline in American society, and the negative consequences this has on individuals and society. It also highlights recent research, including a study that used Facebook data to measure the importance of economic connectedness, and mentions the challenges of studying social capital and the benefits of integration. However, the main idea is&nbsp;</span><span style="font-family: ;color: #000000;">centered</span><span style="font-family: ;color: #000000;"> around the decline of social interaction and its consequences.</span>\r<br /><span style="font-family: ;color: #000000;">Option 4: While the passage discusses the difficulty of experimentally varying a person\'s social capital, this is not the main idea of the passage.</span><span style="font-family: ;color: #000000;">Hence, [3].</span>',
