              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '</span>\t<span style="font-family: ;color: #000000;">The correct answer is 2. Though the passage mentions that the researchers found that intra-class friendships were most easily formed in religious settings, it does not suggest that the author supports the view that religious settings are the most effective institutions for promoting social capital.</span>\r<br /><span style="font-family: ;color: #000000;">Option 1 is supported by the last paragraph. The mention of anomie in the paragraph justifies option 3. Option 4 is supported as ‘economic connectedness’ is a part of social capital.</span><span style="font-family: ;color: #000000;"> Hence, [2].</span>',
