                '<b>The four sentences (labelled 1, 2, 3 and 4) below, when properly sequenced would yield a coherent paragraph. Decide on the proper sequencing of the order of the sentences and key in the sequence of the four numbers as your answer.</b><br><br>1.\t<span style="font-family: ;color: #000000;">Throughout my life, I have dedicated myself to comprehending the world I was born into and have had some success in doing so.</span><br><span style="font-family: ;color: #000000;">2.</span>\t<span style="font-family: ;color: #000000;">As participants, we seek to change the world to our advantage while as observers we aim to understand the world as it is.</span><br><span style="font-family: ;color: #000000;">3.</span>\t<span style="font-family: ;color: #000000;">I have come to the realization that our understanding of the world will always be imperfect because we are both participants and observers in it.</span><br><span style="font-family: ;color: #000000;">4.</span>\t<span style="font-family: ;color: #000000;">As a result, these two objectives often interfere with each another.</span><br><br><span style="font-family: ;color: #000000;">[quizky-text]',
