              Items:
                '<b>The four sentences (labelled 1, 2, 3 and 4) below, when properly sequenced would yield a coherent paragraph. Decide on the proper sequencing of the order of the sentences and key in the sequence of the four numbers as your answer.</b><br><br>1.\t<span style="font-family: ;color: #000000;">While speculation has been known to lead to the bursting of market bubbles, such as the tulip craze in seventeenth-century Amsterdam and the more recent 2008 global financial crisis, it is also the market\'s necessary lubricant.</span><br><span style="font-family: ;color: #000000;">2.</span>\t<span style="font-family: ;color: #000000;">Speculative trades enable market players to calculate risks and generate returns, which help prevent the market from overheating.</span><br><span style="font-family: ;color: #000000;">3.</span>\t<span style="font-family: ;color: #000000;">Speculation, the act of investing in the financial market, carries both destructive and constructive potentials at its core.</span><br><span style="font-family: ;color: #000000;">4.</span>\t<span style="font-family: ;color: #000000;">However, during periods of speculative </span><span style="font-family: ;color: #000000;">fervor</span><span style="font-family: ;color: #000000;">, traders may assign value to abstract concepts that have no tangible link to market fundamentals.</span><br><br><span style="font-family: ;color: #000000;">[quizky-text]',
              ItemPassageID: null,
