              SkippedPoints: 0,
              Explanation:
                '</span>\tSentence 1. Standalone sentence. Negative and positive aspects of speculation. Could be the starter.\r<br /><span style="font-family: ;color: #000000;">Sentence 2. Standalone sentence. Positive aspect of speculation. Good for the starter. However, both sentences are about speculative trades in the markets.</span>\r<br /><span style="font-family: ;color: #000000;">Sentence 3. Defines Speculation – states that it has both negative and positive aspects. Links with 1 as 3-1. The best of the three for the starter.</span>\r<br /><span style="font-family: ;color: #000000;">Sentence 4. “</span><span style="font-family: ;color: #000000;">However</span><span style="font-family: ;color: #000000;">”, in sentence 4 signals a contrast with the sentence that is immediately before it.</span>\r<br /><span style="font-family: ;color: #000000;">Between 2 and 3, 3 is a better starter. 3-1 is a good pair as the ‘destructive’ potential of speculation is carried forward in sentence 1. Though 3-2 is possible, 3-1 is more logical for this reason. Sentence 2 following the 3-1 pair is also logical as the ‘constructive’ potential is suggested in 2.&nbsp;</span><span style="font-family: ;color: #000000;">So</span><span style="font-family: ;color: #000000;"> 3-1-2 is a good sequence. Sentence 4 with ‘however’, provides the immediate contrast to 2 and closes the paragraph.</span>\r<br /><span style="font-family: ;color: #000000;">Therefore, the required answer is 3124.</span>',
