                "<p><strong>The passage given below is followed by four alternate summaries. Choose the option that best captures the essence of the passage.</strong></p>\n<p><br />The act of doomscrolling&mdash;spinning continuously through bad news despite its disheartening and depressing effects&mdash;and social media envy, like the fear of missing out, present greater risks to your health than were previously realized. A tranche of research over the past few years, amid the global coronavirus pandemic, a rise in armed conflicts, and increased economic woes, has offered a glimpse into what leaves us restless at night and the ways social media and our phones exacerbate feelings of helplessness. Spawning from a sense of inadequacy about one&rsquo;s appearance or a perceived lack of achievements, anyone scrolling their phones for extended periods and misusing social media faces an elevated risk of depression, anxiety, loneliness, self-harm, and suicide. But when at least one in five get their news through social media, it seems a near impossibility to disassociate from our digital avatars and the mobile computers we cart with us everywhere. Like most everything in life, moderation is key.</p>",
