                '<b>The passage given below is followed by four alternate summaries. Choose the option that best captures the essence of the passage.</b><br><br><span style="font-family: ;color: #000000;">Studies show that reading ability is more closely linked to a child\'s vocabulary than to their age, and that spoken language skills are a high predictor of later literary skills. However, we know that many children who enter school are behind on their language skills, especially those from disadvantaged backgrounds. Some argue that formal teaching allows these children to access the support and skills that others may pick up informally at home. This line of thinking is espoused by many educational authorities, who say that teaching reading early to those behind on their spoken language is "the only effective route to closing this [language ability] gap".  Others favour the opposite approach, of immersing children in an environment where they can enjoy and develop their language comprehension, which is after all central to reading success.</span>',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '</span>\tMain Points:\r<br /><span style=\'font-family:Symbol\'>·</span><span style="font-family: ;">&nbsp;</span>\tReading ability is linked to vocabulary more than age.\r<br /><span style=\'font-family:Symbol\'>·</span>\tSpoken language skills predict literary skills&nbsp;<span style="font-family: ;">later on</span><span style="font-family: ;">.&nbsp;</span>\r<br /><span style=\'font-family:Symbol\'>·</span><span style="font-family: ;">&nbsp;</span>\tMany children enter school behind on language skills, especially those from disadvantaged backgrounds.&nbsp;\r<br /><span style=\'font-family:Symbol\'>·</span>\tSome argue formal teaching helps disadvantaged children catch up.\r<br /><span style=\'font-family:Symbol\'>·</span><span style="font-family: ;">&nbsp;</span>\tOthers argue for immersion in language-rich environments to develop comprehension.\r<br />\r<br /><span style="font-family: ;color: #000000;">Option 1. The passage is not talking about formal training in spoken language, but ‘teaching reading early.’</span>\r<br /><span style="font-family: ;color: #000000;">Option 2. Option 2 is the best precis because it conveys the main points of the original text in a clear and concise manner. It states that studies show that reading ability is linked to vocabulary and spoken language skills and that many children from disadvantaged backgrounds are behind in these areas. It also highlights that there is debate on the best approach to help these children catch up, which is a key point in the original text.</span>\r<br /><span style="font-family: ;color: #000000;">Option 3. ‘children’ not mentioned in the option. The passages&nbsp;</span><span style="font-family: ;color: #000000;">does</span><span style="font-family: ;color: #000000;"> not say that immersive learning experience is the best approach.</span>\r<br /><span style="font-family: ;color: #000000;">Option 4. ‘acquired at home’ is a misrepresentation. ‘the only way’ is incorrect.</span>\r<br /><span style="font-family: ;">Hence, [2].</span',
