                '<b>The passage given below is followed by four alternate summaries. Choose the option that best captures the essence of the passage.</b><br><br><span style="font-family: ;color: #000000;">Many scholars agree that a subjectively meaningful existence often boils down to three factors: the feeling that one’s life is coherent and “makes sense,” the possession of clear and satisfying long-term goals and the belief that one’s life matters in the grand scheme of things. Psychologists call these three things coherence, </span><span style="font-family: ;color: #000000;">purpose</span><span style="font-family: ;color: #000000;"> and existential mattering. But we believe there is another element to consider. Think about the first butterfly you stop to admire after a long winter or imagine the scenery atop a hill after a fresh hike. When people are open to appreciating such experiences, these moments may enhance how they view their life. We call this element experiential appreciation. The phenomenon reflects the feeling of a deep connection to events as they transpire and the ability to extract value from that link.</span>',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '</span>\t\r<br /><span style="font-family: ;color: #000000;"><b>Points:</b></span>\r<br /><span style=\'font-family:Symbol\'>·</span>\tScholars - Meaningful life – coherence,&nbsp;<span style="font-family: ;color: #000000;">purpose</span><span style="font-family: ;color: #000000;"> and belief that one’s life matters (existential mattering)</span>\r<br /><span style=\'font-family:Symbol\'>·</span><span style="font-family: ;color: #000000;">&nbsp;</span>\tAuthor – one more element to be considered, experiential appreciation – the ability to extract value from experiences and improve outlook.\r<br />\r<br /><span style="font-family: ;color: #000000;">Both options 1 and 3 are good precis, but option 3 is more precise in terms of capturing the author\'s emphasis on the addition of experiential appreciation to the concept of a meaningful life. Option 2 is contrary to the passage. The passage does not state that one (psychologists view) or the other (the author’s view) is less or more important. So ‘not as much on … as on’ construction is a distortion. Option 4 is unclear about significance. Besides everything is attributed to Scholars.</span>\r<br />Hence, [3].',
