              Passage:
                '<b> </b><b>The passage below is accompanied by a set of questions. Choose the best answer to each question.</b><br><br><span style="font-family: ;color: #000000;">As beautiful as they are to look at, art masterpieces are not eternal: Pigments and binders in oil paintings inexorably deteriorate. Light, humidity, and temperature fluctuations are the usual culprits, but exposure to some solvents or the mixing of incompatible pigments can also render paint unstable over time. In their effort to understand the chemical reactions that caused degradation in a particular painting, art conservators try to answer three questions: How was the painting made? How did it originally appear? And how did it change? […] By reconstructing how a painting deteriorated, conservators may be able to forestall further damage and better preserve it.</span><br><br><span style="font-family: ;color: #000000;">Paintings conservator and doctoral student </span><span style="font-family: ;color: #000000;">Nouchka</span><span style="font-family: ;color: #000000;"> De Keyser (Rijksmuseum, University of Amsterdam, and University of Antwerp) and her colleagues have scientifically addressed all three questions while examining a yellow rose in Abraham Mignon’s painting </span><span style="font-family: ;color: #000000;">Still Life with Flowers and a Watch</span><span style="font-family: ;color: #000000;"> (circa 1660–79). Yellow roses have long been a problematic motif. To create the flowers’ bright and vibrant appearance, artists since antiquity have used orpiment. But over time the mineral severely </span><span style="font-family: ;color: #000000;">discolored</span><span style="font-family: ;color: #000000;"> the appearance of such items as orange draperies, lemons, yellow flowers, and the sheen of golden metal in several old masterworks…</span><br><br><span style="font-family: ;color: #000000;">In Mignon’s painting, most of the flowers retain beautifully preserved details. But the rose stands out as flat, monochrome, and peppered with microcracks. De Keyser and her colleagues first </span><span style="font-family: ;color: #000000;">analyzed</span><span style="font-family: ;color: #000000;"> the rose using x-ray fluorescence imaging. That technique mapped the spatial distribution of elements, particularly arsenic, calcium, iron, </span><span style="font-family: ;color: #000000;">sulfur</span><span style="font-family: ;color: #000000;">, lead, and copper. Their presence revealed painterly features—light and shadows defining the separate petals and stamens—that are optically invisible in the actual image. Because those elements still reside in the paint layers, the map of the micro-scale distribution of arsenic uncovers the rose in much of its former glory.</span><br><br><span style="font-family: ;color: #000000;">Fluorescence cannot resolve the elements’ molecular phases, though. To identify them, the group used an in-house x-ray powder diffraction scanner. They non-invasively mapped the presence of crystalline pigment phases and degradation products and </span><span style="font-family: ;color: #000000;">analyzed</span><span style="font-family: ;color: #000000;"> the paint surface in reflection mode. The diffraction map primarily identified two lead arsenates as degradation products—</span><span style="font-family: ;color: #000000;">schultenite</span><span style="font-family: ;color: #000000;"> and mimetite. According to the authors, the presence of those lead arsenates accounts for </span>the <span style="font-family: ;color: #000000;">colorless</span><span style="font-family: ;color: #000000;"> appearance of the yellow rose. The original orpiment pigment still exists in the painting only along the border of the rose. The mineral’s bright, vivid yellow in other parts of the flower were transformed into reaction products that are largely transparent. …Mignon is thought to have adopted a multistep method to produce his work. He first blocked out the position of the flowers with a monochrome underpainting and then filled in details by applying glazes for the shadows and orpiment in lighter sections for sunlit parts. Accordingly, the position of the yellow rose was marked with a yellow </span><span style="font-family: ;color: #000000;">ocher</span><span style="font-family: ;color: #000000;"> underpaint rich in iron. In its now degraded state, that underpaint is the only part that is optically visible. The fluorescence map reveals it as a layer rich in iron, and the diffraction map identifies its molecular source as goethite, a key ingredient in the yellow </span><span style="font-family: ;color: #000000;">ocher</span><span style="font-family: ;color: #000000;">. The result is dull, flat, and monochrome…</span>',
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '</span>\tIt can be inferred from the passage that the loss of colour happened because the yellow pigment orpiment is unstable and on exposure to the environment breaks down to “two lead arsenates as degradation products—<span style="font-family: ;color: #000000;">schultenite</span><span style="font-family: ;color: #000000;"> and mimetite” which are largely transparent. Hence options 1, 2, 4 are sustainable statements. Option 4 can be inferred from the general statement in the&nbsp;</span>passage – “Pigments and binders in oil paintings inexorably deteriorate. Light, humidity, and temperature fluctuations are the usual culprits, but exposure to some solvents or the mixing of incompatible pigments can also render paint unstable over time.” Contact with chemical substances through any of these routes cannot be ruled out.  Option 3 states that the arsenates were unstable, whereas the arsenates are degradation products of unstable orpiment. Hence, [3].',
