                '<span style="font-family: ;color: #000000;"></span>\t<span style="font-family: ;color: #000000;">Based on the information in the passage, which of the following best explains Amazon\'s approach to exclusive brand partnerships?</span>',
              ItemPassageID: 16817108635683,
              PassageItemIndex: 0,
              Passage:
                '<b>The passage below is accompanied by a set of questions. Choose the best answer to each question.</b><br><br><span style="font-family: ;color: #000000;">Retailers’ aisles have long been stocked with private-label products, but consumers seem particularly open to them now. </span><span style="font-family: ;color: #000000;">Various</span><span style="font-family: ;color: #000000;"> </span><span style="font-family: ;color: #000000;">market-research firms</span><span style="font-family: ;color: #000000;"> have in recent years sketched a picture of what they call “agnostic shoppers”—informed, savvy consumers who are less loyal to specific brands and stores than to getting a good deal, whether that deal is considered good because of low prices, high quality, or both.</span><br><br><span style="font-family: ;color: #000000;">Private-label products seem a perfect fit for this trend, being both cheaper than brand-name products and comparable to them in quality. Indeed, </span><span style="font-family: ;color: #000000;">a report last year</span><span style="font-family: ;color: #000000;"> from Gartner, a research and consulting firm, found that roughly half of Millennial shoppers said that they were indifferent to whether a product is brand-name or private-label, and that they would buy more private-label goods if the market provided them.</span><br><br><span style="font-family: ;color: #000000;">Retailers like private-label products too—they often have </span><span style="font-family: ;color: #000000;">higher profit margins for stores</span><span style="font-family: ;color: #000000;"> than brand-name goods do. The national grocery chain Kroger has taken a particular liking to them. According to </span><span style="font-family: ;color: #000000;">an article from Reuters earlier this year</span><span style="font-family: ;color: #000000;">, Kroger has a team of 400 employees who develop its private-label products, poring over sales data to pounce on new trends. Each Kroger store, on average, has more than 15,000 house-brand products, </span><span style="font-family: ;color: #000000;">and,</span><span style="font-family: ;color: #000000;"> the sales of these products accounted for about 27 percent of the chain’s grocery sales last year…</span><br><br><span style="font-family: ;color: #000000;">Private-label products currently account for much larger shares of sales for brick-and-mortar stores than they do for online retailers. According to the market-research firm Nielsen, $17 out of every $100 spent in American brick-and-mortar stores goes to private-label brands, while online, private-label products make up only 3 percent of sales of packaged goods…</span><br><br><span style="font-family: ;color: #000000;">A spokesperson for Amazon told me that its private-label products “only account for about 1 percent of our total retail sales.” The company does sell a range of products under Amazon-owned brands, but lately it has been focusing on assembling an arsenal of goods that are made by other companies but </span><span style="font-family: ;color: #000000;">can’t be purchased anywhere except on Amazon</span><span style="font-family: ;color: #000000;">. Forming exclusive brand partnerships allows Amazon to add unique products and plug assortment gaps in high-demand categories without having to spend the resources to develop, manufacture and sell them…</span><br><br><span style="font-family: ;color: #000000;">The market-research firm IRI has found that the prices of private-label products are on average 20 percent lower than those of brand-name products, but there’s apparently such a thing as too good of a deal. Christopher Durham, the private-label consultant, told me a story about working with a retailer on a pack of private-label batteries. Their price was about 60 percent cheaper than what the brand-name version was selling for, but even though Durham said they were of comparable quality, sales were “very, very slow on them.” He and his team experimented with different </span><span style="font-family: ;color: #000000;">prices, and</span><span style="font-family: ;color: #000000;"> arrived at a somewhat amazing conclusion: “We could move the price up to about 25 percent less than the national brand, and the [sales] volume went up about seven times. Which is crazy, right? But [the customer was thinking], </span><span style="font-family: ;color: #000000;">These are so cheap—I don</span><span style="font-family: ;color: #000000;">’</span><span style="font-family: ;color: #000000;">t trust them</span><span style="font-family: ;color: #000000;">.” …</span>',
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '</span>\t<span style="font-family: ;color: #000000;">Option 1. Option 1 is incorrect as the passage specifically states that Amazon\'s exclusive brand partnership strategy involves offering unique products that cannot be found on other e-commerce websites. The focus of the exclusive brand partnership strategy is not discounts.</span>\r<br /><span style="font-family: ;color: #000000;">Option 2. It is incorrect because while Amazon does sell products under its own brand, the exclusive brand partnership strategy focuses on collaborating with other manufacturers to offer unique products that can only be purchased on Amazon.</span>\r<br /><span style="font-family: ;color: #000000;">Option 3. Correct. The passage states that Amazon\'s exclusive brand partnership strategy involves forming partnerships with manufacturers to create unique products that can only be purchased on Amazon. This helps fill gaps in high-demand categories and differentiate Amazon\'s platform from its competitors.</span>\r<br /><span style="font-family: ;color: #000000;">Option 4. This option is incorrect. While Amazon does offer a wide range of products, the exclusive brand partnership strategy focuses on adding exclusive products to the platform.</span>\r<br /><span style="font-family: ;color: #000000;">Hence, [3].</span>',
