              Items:
                '<p class="MsoNormal" style="margin-bottom: 3.0pt; line-height: normal;">Find the sum of the amounts spent (in Rs.) by Jatin, Enaya and Indu.</p>\n<p><br />Enter your response (as an integer) using the virtual keyboard in the box provided below.<br /><br />[quizky-text]</p>',
              ItemPassageID: 16817314416943,
              PassageItemIndex: 0,
              Passage:
                '<p><span style="font-family: Calibri;"><strong>Refer to the data below and answer the questions that follow.</strong></span><br /><br /><span style="font-family: Calibri;">The mess committee of Pataudi Mahavidyalaya consists of ten members namely, Ajay, Bindu, Chandani, Deepti, Enaya, Farzana, Garvit, Harshita, Indu and Jatin. Every Sunday they go to the local fruit market and buy 40 kg of fruits. On a particular Sunday they all collectively bought five types of fruits, namely Apple, Banana, Orange, Mango and Watermelon. Each member of the committee bought a total of 4 kg of fruits of two types. No one bought more than 2 kg of any one type of fruit. Also no two members bought the same combination of fruits. The prices of Apple, Banana, Orange, Mango and Watermelon were Rs. 100, Rs. 50, Rs. 80, Rs, 150 and Rs. 40 per kg in the given order. It is known that Indu bought Watermelons, Enaya bought Bananas and Jatin bought Mangoes. Also the sum of the amounts spent by Bindu, Farzana and Garvit was Rs. 1360 and the sum of the amounts spent by Ajay, Deepti and Harshita was Rs. 680.</span></p>',
              PassageTitle: "q11-15",
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 0,
              SkippedPoints: 0,
              Explanation:
                '<p class="MsoNormal" style="line-height: normal;">Following combinations are possible for each member:</p>\n<p class="MsoNormal" style="line-height: normal;"><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1681817866058_q11-15.JPG" alt="" width="316" height="220" /></p>\n<p class="MsoNormal" style="line-height: normal;">Given, Bindu + Farzana + Garvit = 1360. By simple trial and error, it can be stated that they have bought combinations 3<sup>rd </sup>(Apples + Mangoes = 500), 6<sup>th</sup> (Bananas + Mangoes = 400) and 8<sup>th </sup>(Oranges + Mangoes = 460). Given, Jatin bought Mangoes, thus, Jatin bought Mangoes and Watermelons (300 + 80 = 380).</p>\n<p class="MsoNormal" style="line-height: normal;">Given, Ajay + Deepti + Harshita = 680. By simple trial and error, it can be stated that they have bought combinations 5<sup>th</sup> (Bananas + Oranges = 260), 7<sup>th</sup> (Bananas + Watermelons = 180, 9<sup>th</sup> (Oranges + Watermelons = 240).&nbsp;</p>\n<p class="MsoNormal" style="line-height: normal;">Given that Enaya bought Bananas, it has to be the combination of Bananas and Apples (100 + 200 = 300).&nbsp;</p>\n<p class="MsoNormal" style="line-height: normal;">Also given that Indu bought Watermelons, it has to be the combination of Watermelons and Apples (80 + 200 = 280).</p>\n<p class="MsoNormal" style="line-height: normal;">The combination of Oranges and Apples (200 + 160 = 360) must have been bought by Chandani.</p>\n<p class="MsoNormal" style="line-height: normal;">Jatin + Enaya + Indu = 380 + 300 + 280 = Rs. 960.</p>\n<p>Therefore, the required answer is 960.</p>',
