                '<p class="MsoNormal" style="line-height: normal;">Following combinations are possible for each member:</p>\n<p class="MsoNormal" style="line-height: normal;"><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1681817981447_q11-15.JPG" alt="" width="316" height="220" /></p>\n<p class="MsoNormal" style="line-height: normal;">Given, Bindu + Farzana + Garvit = 1360. By simple trial and error, it can be stated that they have bought combinations 3<sup>rd </sup>(Apples + Mangoes = 500), 6<sup>th</sup> (Bananas + Mangoes = 400) and 8<sup>th </sup>(Oranges + Mangoes = 460). Given, Jatin bought Mangoes, thus, Jatin bought Mangoes and Watermelons (300 + 80 = 380).</p>\n<p class="MsoNormal" style="line-height: normal;">Given, Ajay + Deepti + Harshita = 680. By simple trial and error, it can be stated that they have bought combinations 5<sup>th</sup> (Bananas + Oranges = 260), 7<sup>th</sup> (Bananas + Watermelons = 180, 9<sup>th</sup> (Oranges + Watermelons = 240).&nbsp;</p>\n<p class="MsoNormal" style="line-height: normal;">Given that Enaya bought Bananas, it has to be the combination of Bananas and Apples (100 + 200 = 300).&nbsp;</p>\n<p class="MsoNormal" style="line-height: normal;">Also given that Indu bought Watermelons, it has to be the combination of Watermelons and Apples (80 + 200 = 280).</p>\n<p class="MsoNormal" style="line-height: normal;">&nbsp;</p>\n<p class="MsoNormal" style="line-height: normal;">The combination of Oranges and Apples (200 + 160 = 360) must have been bought by Chandani.</p>\n<p class="MsoNormal" style="line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-ansi-language: EN-IN;">Chandani bought Oranges and Apples.</span></p>\n<p class="MsoNormal" style="line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-ansi-language: EN-IN;">Hence, [1].</span></p>',
