              Passage:
                '<p><span style="font-family: Calibri;"><strong>Refer to the data below and answer the questions that follow.</strong></span><br /><br /><span style="font-family: Calibri;">The mess committee of Pataudi Mahavidyalaya consists of ten members namely, Ajay, Bindu, Chandani, Deepti, Enaya, Farzana, Garvit, Harshita, Indu and Jatin. Every Sunday they go to the local fruit market and buy 40 kg of fruits. On a particular Sunday they all collectively bought five types of fruits, namely Apple, Banana, Orange, Mango and Watermelon. Each member of the committee bought a total of 4 kg of fruits of two types. No one bought more than 2 kg of any one type of fruit. Also no two members bought the same combination of fruits. The prices of Apple, Banana, Orange, Mango and Watermelon were Rs. 100, Rs. 50, Rs. 80, Rs, 150 and Rs. 40 per kg in the given order. It is known that Indu bought Watermelons, Enaya bought Bananas and Jatin bought Mangoes. Also the sum of the amounts spent by Bindu, Farzana and Garvit was Rs. 1360 and the sum of the amounts spent by Ajay, Deepti and Harshita was Rs. 680.</span></p>',
