                '<p>What was the sum of the total area under cultivation in the given four states (in thousand hectares) in the given three years?<br /><br />Enter your response (as an integer) using the virtual keyboard in the box provided below.<br /><br /><span style="font-family: Calibri;">[quizky-text]</span></p>',
              ItemPassageID: 16817314416944,
              PassageItemIndex: 0,
              Passage:
                '<p><span style="font-family: Calibri;"><strong>Refer to the data below and answer the questions that follow.</strong></span><br /><br /><span style="font-family: Calibri;">The data given below is related to crop &lsquo;Pearl Millet&rsquo; over the three years for the four states.</span><br /><span style="font-family: Calibri;">It is known that in 2021-22; Maharashtra spent Rs. 61010 per hectare to cultivate Pearl Millet and by selling the produce, the revenue generated was Rs. 61484 per hectare. Gujarat spent Rs. 56728 per hectare to cultivate and by selling the produce, the revenue generated was Rs. 82173 per hectare.</span></p>\n<p>&nbsp;</p>\n<p>Additionally,<span style="font-family: Calibri;"> the scatter plot below represents the details about the total cost (in Rs.) incurred for cultivating Pearl Millet on one hectare land and gross returns (in Rs.) by selling the produce of one hectare land of Haryana and Uttar Pradesh for the three years 2019-20, 2020-21, 2021-22, and Maharashtra and Gujarat for the years 2019-20 and 2020-21. For example, in 2021-22, Uttar Pradesh spent Rs. 44128 per hectare to cultivate and by selling the produce, the revenue generated was Rs. 45458 per hectare.</span></p>\n<p><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682314613265_2402_2.JPG" alt="" width="650" height="395" /><br /><br /><span style="font-family: Calibri;">B/C ratio is defined as the ratio of Gross Returns to Total Cost. Total Cost includes Operational cost and Fixed cost. </span><br /><br /><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682356742865_2404_4.JPG" alt="" width="638" height="434" /><br /><span style="font-family: Calibri;">The chart above gives the data about the area (in thousand hectares) on which the crop was cultivated and the Production (in thousand tonnes). </span></p>\n<p><span style="font-family: Calibri;">Yield (in kg per hectare) = Production (in kg) / Area (in hectare)</span></p>',
