                '<p>How many units of 10000 gallons of output from refinery in city A should be sent to city B through Pipeline-1?<br /><br />Enter your response (as an integer) using the virtual keyboard in the box provided below.<br /><br /><span style="font-family: Calibri; color: #000000;">[quizky-text]</span></p>',
              ItemPassageID: 16817314416942,
              PassageItemIndex: 0,
              Passage:
                '<p><span style="font-family: Calibri;"><strong>Refer to the data below and answer the questions that follow.</strong></span><br /><br /><span style="font-family: Calibri;">City A has an oil refinery which refines crude oil into various petroleum products with an output capacity of 40000 Gallons per day. It sends all its daily output through two different pipelines to city B in one shot. These two pipelines pass through two different checkpoints. Pipeline-1 passes through checkpoint </span><span style="font-family: Calibri;">C1</span><span style="font-family: Calibri;"> and pipeline-2 passes through checkpoint C2. Any pipeline carries petroleum products in integral multiples of 10000 gallons. Total time taken to carry 10000 gallons of petroleum products from A to C1 and C2 to B is the same, which is 10 hours. If an additional volume of output is sent through these two portions of the pipeline, each additional 10000 gallons increases the total transportation time by 30 minutes and 25 minutes from A to C1 and C2 to B respectively. For example, the time taken to carry 20000 gallons of petroleum from A to C1 is 10 hours and 30 minutes and so on. Similarly, the time taken to carry 20000 gallons of petroleum from C2 to B is 10 hours and 25 minutes and so on.</span><span style="font-family: Calibri, sans-serif; font-size: 11pt;"> </span><span style="font-family: Calibri;">This delay happens because of excess pressure in the pipeline. In a similar way, the total time taken to carry 10000 gallons of petroleum products from A to C2 and C1 to B are the same, which is 3 hours. If an additional volume of output is sent through these two portions of the pipeline, each additional 10000 gallons increases the transportation time by 1 hour and 30 minutes for both the portions. </span><span style="font-family: Calibri;">For example, the time taken to carry 20000 gallons of petroleum from A to C2 and C1 to B is 4 hours and 30 minutes and so on.</span><span style="font-family: Calibri;">&nbsp;</span></p>\n<p><br /><span style="font-family: Calibri;">The pipeline operators send petroleum products through the pipelines in such a way that the total daily produce of the refinery is sent to city-B in the minimum possible over-all transportation time. Any alteration in volumes sent through the pipelines will increase the overall transportation time. No time is wasted at the two checkpoints once the flow starts. &lsquo;Over-all transportation time&rsquo; is the total time from beginning to end to complete the total transportation.</span></p>',
              PassageTitle: "6-10",
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 0,
              SkippedPoints: 0,
              Explanation:
                '<p>Various possibilities are shown below: <br /><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682269933881_2304_2.JPG" alt="" width="639" height="271" />&nbsp;</p>\n<p><br />Thus, to maintain the &ldquo;minimum possible over-all transportation time&rdquo; principle, 20000 gallons of output should be sent through each pipeline. </p>\n<p>Therefore, the required answer is 2.</p>',
