                '<p><strong><span style="text-decoration: underline;"><em>Additional information for this question</em></span>:</strong><br /><br />A new pipe-line connecting C1 and C2 is built. The flow through this new pipeline can move from C2 to C1 only. The pipeline operators can now send petroleum products through three different routes. They are A-C1-B, A-C2-B, and A-C2-C1-B. Time taken to carry 10000 gallons of petroleum products from C2 to C1 is 3.5 hours, and each additional 10000 gallons sent through this pipe line increases the transportation time by 30 minutes. For example, the time taken to carry 20000 gallons of petroleum through the new pipeline is 4 hours and so on.&nbsp;<br /><br />If at most 20000 gallons of petroleum products are to be sent through the new pipeline, how much reduction in overall transportation time (in hours) can be achieved due to availability of this newly built pipeline given that no pipeline remains unused?<br /><br />Enter your response (as an integer) using the virtual keyboard in the box provided below.<br /><br />[quizky-text]</p>',
              ItemPassageID: 16817314416942,
