              Items:
                "<p>Which of the following statement(s) is / are definitely true?</p>\n<p>&nbsp;</p>\n<p>Statement-1: Exactly three teachers received 100% of their points that they earned for the 'Day' classes during the first three sessions.<br />Statement-2: Exactly five teachers received more than one-third of their points that they earned for the entire day during the last three sessions.</p>",
              ItemPassageID: 16817314416941,
              PassageItemIndex: 0,
              Passage:
                '<p><span style="font-family: Calibri;"><strong>Refer to the data below and answer the questions that follow.</strong></span> <br /><br /><span style="font-family: Calibri;">&lsquo;</span><span style="font-family: Calibri; color: #000000;">Skye Coaching</span><span style="font-family: Calibri;">&rsquo;</span><span style="font-family: Calibri; color: #000000;"> offers private tuition to school students. The Kolkata centre operates from 9 am to 7 pm everyday, during which it conducts six </span><span style="font-family: Calibri;">simultaneous </span><span style="font-family: Calibri; color: #000000;">classes every hour with sessions of duration of one hour</span><span style="font-family: Calibri;"> each without any break. Class timings are divided into two groups &ndash; &lsquo;Day&rsquo; classes (9 am &ndash; 3 pm) and &lsquo;Evening&rsquo; classes (3 pm &ndash; 7 pm). </span><span style="font-family: Calibri; background-color: white;">The last session of &lsquo;Day&rsquo; class starts at 2 pm and ends at 3 pm. Similarly, the last session of &lsquo;Evening&rsquo; class starts at 6 pm and ends at 7 pm.</span><span style="font-family: Calibri; font-size: 14px; background-color: white;"> </span><span style="font-family: Calibri;"> Exactly ten teachers teach every day. Every teacher teaches in an equal number of sessions per day.</span> <br /><br /><span style="font-family: Calibri;">Exactly five teachers out of ten teach in six consecutive hours.&nbsp; The order in which they st</span><span style="font-family: Calibri;">art their first classes in the </span><span style="font-family: Calibri;">morning are Falguni Ma&rsquo;am, Govind Sir, Hansika Ma&rsquo;am, Ispa Ma&rsquo;am, and Jayant Sir. During the &lsquo;Day&rsquo; classes, Arijit Sir teaches in the first and the last session only and Bhaskar Sir teaches in the first two hours only. Chaitali Ma&rsquo;am teaches in the first three and the last three sessions of the &lsquo;Day&rsquo; and &lsquo;Evening&rsquo; classes respectively. Debdeep Sir, being the Chief Mentor of the </span><span style="font-family: Calibri;">centre</span><span style="font-family: Calibri;">, remains busy with administrative activities and so, he doesn&rsquo;t teach from 1 pm to 5 pm. Eeshani Ma&rsquo;am does not teach between 2 pm and 6 pm.</span> <br /><br /><span style="font-family: Calibri;">&lsquo;</span><span style="font-family: Calibri; color: #000000;">Skye Coaching</span><span style="font-family: Calibri;">&rsquo;</span><span style="font-family: Calibri; color: #000000;"> uses a mobile app for collecting student-feedback data just after every session. The data is processed by its unique algorithm whose output is three distinct best performing teachers&nbsp; assigned with five points (the best), three </span><span style="font-family: Calibri;">points</span><span style="font-family: Calibri; color: #000000;"> (second best) , and one point (</span><span style="font-family: Calibri;">third best</span><span style="font-family: Calibri; color: #000000;">) respectively. The following table shows the number of points earned for the \'Day\' classes as well as the cumulative number of points earned for all the classes of the day by all the teachers.&nbsp;</span></p>\n<p><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682510349507_2604_1.JPG" alt="" width="395" height="249" />&nbsp;<br /><span style="font-family: Calibri; color: #000000;">Further it is known that</span><span style="font-family: Calibri;">:</span> <br /><span style="font-family: Calibri; color: #000000;">1.</span> Falguni Ma&rsquo;am never became one of the three best performing teachers in two consecutive sessions on that day. <br /><span style="font-family: Calibri; color: #000000;">2.</span> Arijit Sir, who never became one of the three best performing teachers in two consecutive sessions, received more points than Ispa Ma&rsquo;am in one of the sessions when <span style="font-family: Calibri; color: #000000;">both of them</span><span style="font-family: Calibri; color: #000000;"> received some points.</span></p>',
              PassageTitle: "1-5",
