              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '<p>Total number of sessions conducted in a day = 10 &times; 6 = 60</p>\n<p>Therefore, each teacher conducts 6 sessions a day.</p>\n<p>Following is the schedule of the teachers derived based on the information given:<br /><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682579176866_e1-5.JPG" alt="" width="528" height="106" /></p>\n<p>It is understood that exactly three teachers will receive 1, 3, and 5 points every hour.<br /><br />The minimum number of classes taken by a teacher during &lsquo;Day&rsquo; classes are Arijit (2), Bhaskar (2), and Jayant (2). The points that they have earned during &lsquo;Day&rsquo; classes are 4 ( = 1 + 3), 4 ( = 1 + 3), and 6 ( = 1 + 5 or 3 + 3) respectively. Four cases are possible with this data:</p>\n<p><br /><strong>Case-1:</strong></p>\n<p>Jayant gets one point for fifth session and five points for sixth session. Arijit gets one point for first session and three points for sixth session. Bhaskar gets three points for first session and one point for second session. Chaitali gets five, three, and one points for first, second and third sessions respectively. Now, Debdeep cannot earn any point in the first session. So, Debdeep should get 7 points in total in second, third, and fourth sessions together. But that is not possible. Therefore, the case is rejected.</p>\n<p><strong>Case-2:</strong></p>\n<p>Jayant gets one point for fifth session and five points for sixth session. Arijit gets three points for first session and one point for sixth session. Bhaskar gets one point for first session and three points for second session. Chaitali gets five, one, and three points for first, second and third sessions respectively. Now, Debdeep cannot earn any point in the first session. So, Debdeep should get five, one, one points in second, third, and fourth sessions respectively. Thus, Eshani should get one point in total in first five sessions. But that is not possible. Therefore, the case is rejected.</p>\n<p><strong>Case-3:</strong></p>\n<p>Jayant gets five points for fifth session and one point for sixth session. Arijit gets one point for first session and three points for sixth session. Bhaskar gets three points for first session and one point for second session. Chaitali gets five, three, and one points for first, second and third sessions respectively. Now, Debdeep cannot earn any point in the first session. So, Debdeep should get 7 points in total in second, third, and fourth sessions together. But that is not possible. Therefore, the case is rejected.</p>\n<p><strong>Case-4:</strong></p>\n<p>Jayant gets three points for both fifth and sixth sessions. Now, according to point (1), Falguni Ma&rsquo;am never became one of the three best performing teachers in two consecutive sessions on that day. Therefore, we get the following.</p>\n<p class="MsoNormal" style="margin-bottom: 0in; line-height: normal;"><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682579969284_e1-5-1.JPG" alt="" width="336" height="273" /></p>\n<p class="MsoNormal" style="margin: 10pt 0in 12pt; line-height: 18.4px;">Further, from the data related to points earned by various teachers during &lsquo;Evening&rsquo; classes, we can complete the following table.</p>\n<p><img src="https://crampete.s3.ap-south-1.amazonaws.com/uploads/ims/2023/4/1682580019752_e1-5-2.JPG" alt="" width="614" height="270" /></p>\n<p><strong>Note</strong>:&nbsp;&nbsp;&nbsp;&nbsp;If we assign 5 and 1 points to Ispa Ma&rsquo;am for 8<sup>th</sup>&nbsp;and 9<sup>th</sup>&nbsp;sessions respectively, then Arijit Sir will receive 3 points in both 8<sup>th</sup>&nbsp;and 10<sup>th</sup>&nbsp;session. That will violate the second condition given in the question. Thus, that possibility has been rejected.</p>\n<p>&nbsp;</p>\n<p><span style="color: #000000;">St-1 is true for Bhaskar, Chaitali, and Govind, whereas, St-2 is true for Arijit, Debdeep, Eeshani, Ispa, &amp; Jayant.</span></p>\n<p><span style="color: #000000;">Hence, [3].</span></p>',
