                '<span style="font-family: ;color: #000000;"></span>\tA pitcher is filled with corn syrup and a second pitcher is filled with pure water. Half of the corn syrup and half of the pure water are poured into a large glass bowl. Next, one-third of the remaining corn syrup from the first pitcher and half of the remaining pure water from the second pitcher is again poured into the glass bowl. Now, the volumes of corn syrup and pure water left in the two pitchers are the same. Then the ratio of corn syrup and pure water in the large glass bowl is _________.',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                "<p>Let the volumes of corn syrup in the first pitcher and that of pure water in the second pitcher be 6A and 4B. </p>\n<p>After first round of transfer, volume of corn syrup left in first pitcher = 3A and volume of pure water left in second pitcher = 2B </p>\n<p>After second round of transfer, volume of corn syrup left in first pitcher = 2A and volume of pure water left in second pitcher = B <br />According to the question, 2A = B </p>\n<p>Therefore, in the large glass bowl, <br />volume of corn syrup : volume of pure water = 4A : 3B = 2B : 3B = 2 : 3 </p>\n<p>Hence, [3].</p>",
