              Items:
                "Let ABCDEF be a regular hexagon with each side of length 1 cm. Then the value of \\({l(BE) \\over {l(BC)}}\\) is:",
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '<p>Let the side of the regular hexagon be 1 cm&nbsp;<span style="font-family: Cambria Math;">&rArr;</span>&nbsp;BC = 1 cm <br /><img style="vertical-align: middle;" src="http://campusquizkybv.blob.core.windows.net/bvcdevitemimages/docximg_1236748894_image1.png" data-docx-image="image1.png" /> <br />Value of each internal angle of a regular hexagon is 120<sup>o</sup>. </p>\n<p>We connect BE and CF. Suppose, they intersect each other at O. </p>\n<p>The diagonals will always internally bisect the internal angles of the regular hexagon. <br />Therefore, the measure of&nbsp;<span style="font-family: Cambria Math;">&ang;</span>OBC and&nbsp;<span style="font-family: Cambria Math;">&ang;</span>OCB are both 60<sup>o</sup>. <br />As a result, ∆BOC becomes an equilateral triangle. The same is true for ∆EOF. </p>\n<p><span style="font-family: Cambria Math;">&there4;</span> BO = EO = BC and thus,&nbsp;\\({l(BE) \\over {l(BC)}}\\) = 2. </p>\n<p>Hence, [3].</p>',
