                '<span style="font-family: ;color: #000000;"></span>\t17 glass balls of distinct colours and distinct weights have been arranged in a row. The weight of the red ball is 17 kg. The average weight of all balls other than the green one is 8.5625 kg. The average weight of all the balls is 500 gm more than the average weight of 16 balls other than the red one. The weight of the green ball, in kg, is __________ .<br><br>Enter your response (as an integer) using the virtual keyboard in the box provided below.<br><br>[quizky-text]',
