              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 0,
              SkippedPoints: 0,
              Explanation:
                '<p>Suppose the weight of the green ball is G kg and that of the 15 balls other than green and red is W kg. </p>\n<p><span style="font-family: Cambria Math;">&there4;</span> W = 8.5625&nbsp;&times; 16&nbsp;&ndash; 17 = 120 </p>\n<p><span style="font-family: Cambria Math;">&there4;</span>&nbsp;\\({17+120+G \\over {17}}‒{120+G \\over {16}}={1 \\over {2}}\\) </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span>&nbsp;\\({120+G \\over {16}}‒{120+G \\over {17}}={1 \\over {2}}\\) </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span> 120 + G = 136&nbsp; </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span> G = 16 kg <br /><br />Therefore, the required answer is 16.</p>',
