                'In the given figure, O and N are the centres of outer and inner circles respectively. Chord PQ is parallel to the common tangent to both the given circles. PQ = 12 units.  Find the radius of the larger circle.<br>\t<img src="http://campusquizkybv.blob.core.windows.net/bvcdevitemimages/docximg_1233634509_image9.png" data-docx-image="image9.png" style="vertical-align: middle;" />',
