                '<p><br /><img style="vertical-align: middle;" src="http://campusquizkybv.blob.core.windows.net/bvcdevitemimages/docximg_1236748894_image5.png" data-docx-image="image5.png" /> <br />PQ = 12 <br /><span style="font-family: Cambria Math;">&rArr;</span>&nbsp;PN = 6 </p>\n<p>(OP)<sup>2</sup> = (PN)<sup>2</sup> + (ON)<sup>2</sup> <br />(OP)<sup>2</sup> = (PN)<sup>2</sup> +&nbsp;\\(({1 \\over {2}}OP)^{2}\\)&nbsp; <br /><span style="font-family: Cambria Math;">&rArr;</span>&nbsp;\\({3 \\over {4}}\\) (OP)<sup>2</sup> = (PN)<sup>2</sup> <br /><span style="font-family: Cambria Math;">&rArr;</span>&nbsp;\\({3 \\over {4}}\\) (OP)<sup>2</sup> = (6)<sup>2</sup> <br /><br /><img style="vertical-align: middle;" src="http://campusquizkybv.blob.core.windows.net/bvcdevitemimages/docximg_1236748894_image6.png" data-docx-image="image6.png" /> </p>\n<p>Hence, [1].</p>',
