              Items:
                '<span style="font-family: ;color: #000000;"></span>\tIf for any natural number n, F<sub>n</sub>(x) = f(f(f( … n-number of times(x)))) where f(x) = 5 + 3x for any real x, then F<sub>10</sub>(10) is _________.',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '<p>f(x) = 5 + 3x&nbsp; </p>\n<p><span style="font-family: Cambria Math;">&there4;</span> F<sub>1</sub>(10) = f(10) = 5&nbsp;+&nbsp;3&nbsp;&times;&nbsp;10 = 5&nbsp;&times;&nbsp;1 + 3<sup>1</sup><sup>&nbsp;</sup>&times;&nbsp;10 </p>\n<p>F<sub>2</sub>(10) = f(f(10) = f (5&nbsp;&times;&nbsp;1 + 3<sup>1</sup><sup>&nbsp;</sup>&times;&nbsp;10) = 5 + 3&nbsp;&times;&nbsp;(5&nbsp;&times;&nbsp;1 + 3<sup>1</sup><sup>&nbsp;</sup>&times;&nbsp;10) = 5&nbsp;&times;&nbsp;(1 + 3) + 3<sup>2</sup><sup>&nbsp;</sup>&times; 10 <br />&nbsp; <br />F<sub>3</sub>(10) = f(f(f(10))) = f(5 &times; (1 + 3) + 3<sup>2&nbsp;</sup>&times; 10) = 5 + 3 &times; {5 &times; (1 + 3) + 3<sup>2&nbsp;</sup>&times; 10} = 5 &times; (1 + 3 + 3<sup>2</sup>) + 3<sup>3&nbsp;</sup>&times; 10 </p>\n<p>Therefore,&nbsp;F<sub>n</sub>(10) = 5 &times; (1 + 3 + 3<sup>2&nbsp;</sup>+ ... + 3<sup>n‒1</sup>) + 3<sup>n&nbsp;</sup>&times; 10 = 5 &times;&nbsp;\\({3^{n} ‒1 \\over {2}}\\) + 3<sup>n&nbsp;</sup>&times; 10 </p>\n<p><span style="font-family: Cambria Math;">&there4;</span> F<sub>10</sub>(10) = 5 &times;&nbsp;\\({3^{10} ‒1 \\over {2}}\\) + 3<sup>10&nbsp;</sup>&times; 10 = 147620 + 590490 = 738110 </p>\n<p>Hence, [1]. <br /><br /><em>Alternatively</em>; <br />F<sub>1</sub>(10) = f(10) = 5&nbsp;+&nbsp;3&nbsp;&times;&nbsp;10 =35 <br />F<sub>2</sub>(10) = f(35) = 5&nbsp;+&nbsp;3&nbsp;&times;&nbsp;35 = 110 <br />F<sub>3</sub>(10) = f(110) = 5&nbsp;+&nbsp;3&nbsp;&times;&nbsp;110 = 335 <br />&hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; &hellip; <br />F<sub>9</sub>(10) = f(82010) = 5&nbsp;+&nbsp;3&nbsp;&times;&nbsp;82010 = 246035 <br />F<sub>10</sub>(10) = f(246035) = 5&nbsp;+&nbsp;3&nbsp;&times;&nbsp;246035 = 738110</p>',
