                'Time taken by 7 men and 8 robots to complete a job working together is 70% less than the same job done by 3 men and 2 robots. If 6 robots finish a job in 4 days, then the number of days required by a group of three men to finish the same job is __________ .<br><br><span style="font-family: ;color: #000000;">Enter your response (as an integer) using the virtual keyboard in the box provided below.</span><br><br><span style="font-family: ;color: #000000;">[quizky-text]</span>',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 0,
              SkippedPoints: 0,
              Explanation:
                '<p>Let, the amount of work done in a single day by a man and a robot be M and R units respectively. </p>\n<p><span style="font-family: Cambria Math;">&there4;</span>&nbsp;\\({W \\over {3M+2R}}\\)&nbsp;&times; (100 ‒ 70)% =&nbsp;\\({W \\over {7M+8R}}\\) <br /><span style="font-family: Cambria Math;">&rArr;</span> 21M + 24R = 30M + 20R <br /><span style="font-family: Cambria Math;">&rArr;</span> 9M = 4R </p>\n<p>Suppose, three men will require D days to complete the job that is done by 6 robots in 4 days <br /><span style="font-family: Cambria Math;">&there4;</span> 3MD = 6&nbsp;&times; R&nbsp;&times; 4 <br /><span style="font-family: Cambria Math;">&rArr;</span> 3MD = 6&nbsp;&times; 4&nbsp;&times;&nbsp;\\({9M \\over {4}}\\) <br /><span style="font-family: Cambria Math;">&rArr;</span> D = 18 </p>\n<p>Therefore, the required answer is 18.</p>',
