              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                "<p>Suppose, the initial total income of all the households in the locality was&nbsp;I and the population was P. </p>\n<p>Let, the new population after 5 years of the given locality be&nbsp;P<sub>n</sub>. </p>\n<p>\\(\\)\\(&there4;{1.35I \\over {P_{n}}}={I \\over {P}} &times; 1.25\\) </p>\n<p>\\(\\)\\(&rArr;{P_{n} \\over {P}}={1.35 \\over {1.25}}\\) </p>\n<p>\\(\\)\\(&rArr;{P_{n} \\over {P}} ‒1={27 \\over {25}} &ndash; 1\\) </p>\n<p>\\(&rArr;({P_{n} \\over {P}} ‒1) &times; 100= 8%\\) </p>\n<p>Hence, [3].</p>",
