              Items:
                '<span style="font-family: ;color: #000000;"></span>\tOn a triangle ABC, a circle with diameter BC is drawn, intersecting AB and AC at points P and Q, respectively. If the lengths of AP, BP, BQ and PC are x cm, 39 cm, 60 cm, and 52 cm respectively, then the length of AQ, in cm, is ____________________.',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '<p><br /><img style="vertical-align: middle;" src="http://campusquizkybv.blob.core.windows.net/bvcdevitemimages/docximg_1236748894_image7.png" data-docx-image="image7.png" /> <br />BC is the diameter of the circle. <br /><span style="font-family: Cambria Math;">&there4;</span> AB&nbsp;<span style="font-family: Cambria Math;">&perp;</span> PC and AC&nbsp;<span style="font-family: Cambria Math;">&perp;</span> BQ </p>\n<p>It is given that BP = 39 cm and PC = 52 cm <br /><span style="font-family: Cambria Math;">&there4;</span> Length of BC = 65 cm </p>\n<p>Again, BQ = 60 cm <br /><span style="font-family: Cambria Math;">&there4;</span> Length of QC = 25 cm </p>\n<p><span style="font-family: Cambria Math;">&there4;</span>&nbsp;\\({1 \\over {2}}\\) &times; AB &times; PC =&nbsp;\\({1 \\over {2}}\\) &times; AC &times; BQ&nbsp; </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span> (x + 39)&nbsp;&times; 52 = (AQ + 25)&nbsp;&times; 60 </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span> 13x + 507 = 15AQ + 375 </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span> AQ =&nbsp;\\({13x + 132 \\over {15}}\\) </p>\n<p>Hence, [1].</p>',
