                '<span style="font-family: ;color: #000000;"></span>\tLet a<sub>1</sub>, a<sub>2</sub>, a<sub>3</sub>, …, a<sub>10</sub> be a sequence of ten consecutive natural numbers. Consider a new sequence of ten consecutive even numbers having 2a<sub>10</sub> - 2 as the last term of the sequence. If the sum of the numbers in the new sequence is 210, then the average of the numbers of the original sequence without a<sub>10 </sub>is ___________.',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                'The numbers in the new sequence are:\r<br /><br />\t<span style="font-family: ;">2a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 20, 2a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 18, 2a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 16, … … , 2a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 2.</span>\r<br /><br />\t<span style="font-family: Cambria Math;">∴</span><span style="font-family: ;"> The sum of the numbers in the new sequence is = 10&nbsp;</span>×<span style="font-family: ;"> 2a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 2(1</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">+</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">2</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">+</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">3</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">+ …&nbsp;</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">+</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">10) = 20a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 110</span>\r<br /><br />\t<span style="font-family: Cambria Math;">∴</span><span style="font-family: ;"> 20a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> – 110 = 210</span>\r<br /><br />\t<span style="font-family: Cambria Math;">⇒</span><span style="font-family: ;"> a</span><span style="font-family: ;"><sub>10</sub></span><span style="font-family: ;"> = 16</span>\r<br /><br />\t<span style="font-family: ;">Thus, the original numbers are 7, 8, 9, …, 16 and the average of the numbers without 16 is 11.</span>\r<br /><br />\t<span style="font-family: ;">Hence, [2].</span>',
