                '<span style="font-family: ;color: #000000;"></span>\tThe perimeter of a rectangle is larger than that of an equilateral triangle by 88 cm. The numerical value of the area of the rectangle in sq. cm is equal to the square of the numerical value of the area of the equilateral triangle expressed in the same unit. The length of the rectangle is 33\\({1 \\over {3}}\\)% more than the breadth of the rectangle. The length of the diagonal of the rectangle, in cm, is ____________ .',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '<p>Let the length and breadth of the rectangle be (4k) cm and (3k) cm. <br />Let the length of each side of the equilateral triangle be &lsquo;a&rsquo; cm. </p>\n<p><span style="font-family: Cambria Math;">&there4;</span>&nbsp;\\({3 \\over {16}}\\) a<sup>4&nbsp;</sup>= 12k<sup>2</sup>&nbsp; <br /><span style="font-family: Cambria Math;">&rArr;</span> a<sup>4</sup> = 64k<sup>2</sup> <br /><span style="font-family: Cambria Math;">&rArr;</span> a<sup>2</sup> = 8k </p>\n<p>Now, 3a + 88 = 14k </p>\n<p><span style="font-family: Cambria Math;">&rArr;</span> 12a + 352 = 7a<sup>2</sup> <br /><span style="font-family: Cambria Math;">&rArr;</span> 7a<sup>2</sup> ‒ 12a ‒ 352 = 0 <br /><span style="font-family: Cambria Math;">&rArr;</span> 7a<sup>2</sup> ‒ 56a + 44a ‒ 352 = 0 <br /><span style="font-family: Cambria Math;">&rArr;</span> (a&nbsp;‒ 8)(7a + 44) = 0 <br /><span style="font-family: Cambria Math;">&there4;</span> a = 8 and k = 8 </p>\n<p><span style="font-family: Cambria Math;">&there4;</span> The length of the diagonal of the rectangle = 5k = 40 cm </p>\n<p>Hence, [1].</p>',
