                "Sonu is a salesman. His annual target is to sell 100 water purifiers. In the first two quarters of the year, he could sell only 5 water purifiers per month. In the third quarter, his monthly sales average increased by 20% in comparison to the first two quarters' monthly sales average. How many water purifiers Sonu will have to sell in the last quarter of the year if his annual target has been reduced by 10%?",
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
              PassageTitle: null,
              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                "<p>Total number of purifiers sold in first two quarters = 2&nbsp;&times; 3&nbsp;&times; 5 = 30 </p>\n<p>Number of purifiers sold in the third quarter = (5 + 20% of 5)&nbsp;&times; 3 = 18 </p>\n<p>Revised annual sales target = 100 ‒ 10% of 100 = 90 </p>\n<p>Thus, Sonu will have to sell another {90 ‒ (30 + 18)} purifiers i.e. 42 purifiers in the last quarter. </p>\n<p>Hence, [3].</p>",
