              Items:
                '<span style="font-family: ;color: #000000;"></span>\tFind the sum of 5 × 9 + 9 × 13 + 13 × 17 + … + 97 × 101',
              ItemPassageID: null,
              PassageItemIndex: 0,
              Passage: null,
