              IsLinkedQuestion: null,
              Points: 3,
              NegativePoints: 1,
              SkippedPoints: 0,
              Explanation:
                '<p>In the given expression the first term of the products&nbsp;are 5, 9, 13, &hellip;, 97 which are in AP with a common difference of 4.</p>\n<p>In a similar way, the second term of the products are 9, 13, 17, &hellip;, 101 which are in AP with a common difference of 4.</p>\n<p>There are a total of 24 terms present in both the series.</p>\n<p>T<sub>1</sub> = 5 &times; 9 = (4 &times; 1 + 1) &times; (4 &times; 2 + 1)&nbsp; <br />T<sub>2</sub> = 9 &times; 13 = (4 &times; 2 + 1) &times; (4 &times; 3 + 1) <br />T<sub>3</sub> = 13 &times; 17 = (4 &times; 3 + 1) &times; (4 &times; 4 + 1) <br /><span style="font-family: Cambria Math;">&there4;</span> T<sub>n</sub> = (4n + 1) &times; {4 &times; (n + 1) + 1} = (4n + 1)&times; (4n + 5) = 16n<sup>2</sup> + 24n + 5 <br /><span style="font-family: Cambria Math;">&there4;</span> 5&nbsp;&times; 9 + 9&nbsp;&times; 13 + 13&nbsp;&times; 17 +&nbsp;&hellip; + 97&nbsp;&times; 101&nbsp; <br />= 16 &times; (1<sup>2</sup> + 2<sup>2</sup> + 3<sup>2</sup> + &hellip; + 24<sup>2</sup>) + 24 &times; (1 + 2 + 3 + &hellip; + 24) + 5 &times; 24 <br />= 16 &times; 4900 + 24 &times; 300 + 120 <br />= 85720</p>\n<p>Hence, [1].</p>\n<p><em>Alternatively</em><strong>;</strong> <br />5 &times; 9 + 9 &times; 13 + 13 &times; 17 + &hellip; + 97 &times; 101 <br />= (7 &ndash; 2)(7 + 2) + (11 &ndash; 2) (11 + 2) + ............... + (99 &ndash; 2)(99 + 2) <br />= (7<sup>2</sup> &ndash; 2<sup>2</sup>) + (11<sup>2</sup> &ndash; 2<sup>2</sup>) + &hellip; + (99<sup>2</sup> &ndash; 2<sup>2</sup>) <br />= (7<sup>2</sup> + 11<sup>2</sup> + &hellip; + 99<sup>2</sup>)&nbsp;‒&nbsp;(24 &times;&nbsp;2<sup>2</sup>) </p>\n<p><span style="font-family: Cambria Math;">&there4;</span> The sum&nbsp; =&nbsp;\\((\\sum\\limits_{n=1}^{24}(4n+3)^{2})\\) - 96&nbsp; <br /><br />=&nbsp;\\((\\sum\\limits_{n=1}^{24}(16n^{2}+24n+9))\\) - 96 <br /><br />=&nbsp;16 &times;&nbsp;\\({24 &times; 25 &times; 49 \\over {6}} + 24 &times;{24 &times; 25 \\over {2}}\\)<span style="font-size: 18.7px;">&nbsp;</span>+ 9 &times; 24&nbsp; &ndash; 96 <br /><br />= 78400 + 7200 + 120 = 85720</p>',
