                'Find the largest natural number which will definitely divide 4<span style="font-family: ;font-size: 16px;"><sup>n</sup></span> ‒ 3n ‒ 1 where n is a natural number greater than 1.<br><br><span style="font-family: ;color: #000000;">Enter your response (as an integer) using the virtual keyboard in the box provided below.</span><br><br><span style="font-family: ;color: #000000;">[quizky-text]</span>',
