              Explanation:
                '</span>\t\r<br /><span style="font-family: ;">4</span><span style="font-family: ;"><sup>n</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">3n&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">1</span>\r<br /><span style="font-family: ;">= (3 + 1)</span><span style="font-family: ;"><sup>n</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">3n&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">1</span>\r<br /><span style="font-family: ;">If we take n = 2 then:&nbsp;</span>\t(3 + 1)<span style="font-family: ;font-size: 16px;"><sup>2</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">–</span><span style="font-family: ;"> 3</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">×</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">2&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">1 = 9</span>\r<br /><span style="font-family: ;">If we take n = 3 then:&nbsp;</span>\t(3 + 1)<span style="font-family: ;font-size: 16px;"><sup>3</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">–</span><span style="font-family: ;"> 3</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">×</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">3</span><span style="font-family: ;"> ‒&nbsp;</span><span style="font-family: ;">1 = 54</span>\r<br /><span style="font-family: ;">If we take n = 4 then:&nbsp;</span>\t(3 + 1)<span style="font-family: ;"><sup>4</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">3</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">×</span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">4&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">1 = 243</span>\r<br /><span style="font-family: ;">All of them are divisible by 9.</span>\r<br />\r<br /><span style="font-family: ;">To generalise, we can say&nbsp;</span><span style="font-family: ;">that,</span><span style="font-family: ;"> (3 + 1)</span><span style="font-family: ;"><sup>n</sup></span><span style="font-family: ;"> = 1 + 3n + 3</span><span style="font-family: ;"><sup>2</sup></span><span style="font-family: ;"> × (some natural number)&nbsp;</span>\r<br /><span style="font-family: ;">Therefore, 4</span><span style="font-family: ;"><sup>n</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">3n&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">1 = 9 × (some natural number)&nbsp;</span>\r<br /><span style="font-family: ;">So, 4</span><span style="font-family: ;"><sup>n</sup></span><span style="font-family: ;">&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;">3n&nbsp;</span><span style="font-family: ;">‒&nbsp;</span><span style="font-family: ;"> 1 will always be divisible 9 where n is a natural number greater than 1.</span>\r<br />\r<br /><span style="font-family: ;">Therefore, the required answer is 9.</span>\r',
